import React, { useRef, useState } from 'react';
import axios from 'axios';
import './VideoEditor.css';

export default function VideoEditor() {
  const inputRef = useRef();
  const [videoFile, setVideoFile] = useState(null);
  const [preview, setPreview] = useState(null);
  const [output, setOutput] = useState(null);
  const [loading, setLoading] = useState(false);
  const [primaryTool, setPrimaryTool] = useState('');
  const [secondaryTool, setSecondaryTool] = useState('');
  const [start, setStart] = useState(0);
  const [end, setEnd] = useState(5);
  const [effect, setEffect] = useState('grayscale');

  const handleUpload = e => {
    const file = e.target.files[0];
    if (file?.type.startsWith('video/')) {
      setVideoFile(file);
      setPreview(URL.createObjectURL(file));
      setOutput(null);
    }
  };

  const handleProcess = async () => {
    if (!videoFile || (!primaryTool && !secondaryTool)) return alert('Select tool & upload video.');

    const activeTool = primaryTool || secondaryTool;
    setLoading(true);
    const fd = new FormData();
    fd.append('video', videoFile);
    fd.append('tool', activeTool);
    if (activeTool === 'clip') {
      fd.append('start', start);
      fd.append('end', end);
    }
    if (activeTool === 'effect') fd.append('effect_type', effect);

    try {
      const res = await axios.post('http://localhost:8000/process', fd, {
        headers: { 'Content-Type': 'multipart/form-data' },
        responseType: 'blob',
      });
      setOutput(URL.createObjectURL(new Blob([res.data], { type: 'video/mp4' })));
    } catch {
      alert('Processing failed.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="editor-container">
      {/* Hidden file input */}
      <input ref={inputRef} type="file" accept="video/*" onChange={handleUpload} hidden />

      {/* Left Sidebar - Primary Tools */}
      <aside className="sidebar">
        <button
          className={primaryTool === 'bg' ? 'active' : ''}
          onClick={() => { setPrimaryTool('bg'); setSecondaryTool(''); }}
        >
          üó∫ BG Removal
        </button>
        <button
          className={primaryTool === 'obj' ? 'active' : ''}
          onClick={() => { setPrimaryTool('obj'); setSecondaryTool(''); }}
        >
          üß± Object Removal
        </button>
        <button onClick={() => inputRef.current.click()}>üìÅ Upload</button>
      </aside>

      {/* Main Area */}
      <main className="main-area">
        {preview && <video src={preview} controls className="preview-video" />}

        {/* Bottom Toolbar - Secondary Tools */}
        <div className="toolbar">
          <button onClick={() => { setSecondaryTool('clip'); setPrimaryTool(''); }}>Clip</button>
          <button onClick={() => { setSecondaryTool('crop'); setPrimaryTool(''); }}>Crop</button>
          <button onClick={() => { setSecondaryTool('effect'); setPrimaryTool(''); }}>Effects</button>
        </div>

        {/* Secondary Tool Controls */}
        {secondaryTool === 'clip' && (
          <div className="tool-controls">
            <label>Start (s): <input type="number" value={start} onChange={e => setStart(e.target.value)} /></label>
            <label>End (s): <input type="number" value={end} onChange={e => setEnd(e.target.value)} /></label>
          </div>
        )}
        {secondaryTool === 'effect' && (
          <div className="tool-controls">
            <label>Effect:
              <select value={effect} onChange={e => setEffect(e.target.value)}>
                <option value="grayscale">Grayscale</option>
                <option value="invert">Invert</option>
                <option value="blur">Blur</option>
              </select>
            </label>
          </div>
        )}

        {/* Process Button & Loading */}
        <div className="action-bar">
          <button onClick={handleProcess} disabled={loading}>
            {loading ? 'Processing...' : 'Apply'}
          </button>
        </div>

        {/* Output Video */}
        {output && (
          <div className="output">
            <h4>Result:</h4>
            <video src={output} controls className="output-video" />
            <a href={output} download="result.mp4"><button>Download</button></a>
          </div>
        )}
      </main>
    </div>
  );
}
